--DATABASE IMPLEMENTATION
-- 1. MEMBERSHIP_PLAN Table
CREATE TABLE MEMBERSHIP_PLAN (
    Plan_ID INT PRIMARY KEY IDENTITY(1,1),
    Type_Name VARCHAR(50) NOT NULL,
    Price DECIMAL(8,2) NOT NULL,
    Class_Limit INT NULL,
    OffPeak_Access BIT NOT NULL,
    Free_Session_per_month INT NOT NULL
);

-- 2. SPECIALISATION Table
CREATE TABLE SPECIALISATION (
    Spec_ID INT PRIMARY KEY IDENTITY(1,1),
    Specialisation VARCHAR(100) NOT NULL
);

-- 3. MEMBER Table
CREATE TABLE MEMBER (
    Mem_ID INT PRIMARY KEY IDENTITY(1,1),
    First_Name VARCHAR(50) NOT NULL,
    Last_Name VARCHAR(50) NOT NULL,
    DOB DATE NOT NULL,
    Gender VARCHAR(10) NOT NULL,
    Email VARCHAR(100) NOT NULL,
    Phone VARCHAR(20),
    Registered_Date DATE NOT NULL,
    Cancellation_Date DATE NULL,
    Plan_ID INT NOT NULL,
    FOREIGN KEY (Plan_ID) REFERENCES MEMBERSHIP_PLAN(Plan_ID)
);

-- 4. TRAINER Table
CREATE TABLE TRAINER (
    Trainer_ID INT PRIMARY KEY IDENTITY(1,1),
    First_Name VARCHAR(50) NOT NULL,
    Last_Name VARCHAR(50) NOT NULL,
    Email VARCHAR(100) NOT NULL,
    Phone VARCHAR(20),
    Spec_ID INT NOT NULL,
    FOREIGN KEY (Spec_ID) REFERENCES SPECIALISATION(Spec_ID)
);

-- 5. FITNESS_CLASS Table
CREATE TABLE FITNESS_CLASS (
    Class_ID INT PRIMARY KEY IDENTITY(1,1),
    Class_Name VARCHAR(100) NOT NULL,
    Day_of_Week VARCHAR(20) NOT NULL,
    Start_Time TIME NOT NULL,
    End_Time TIME NOT NULL,
    Duration INT NOT NULL, -- duration in minutes
    Capacity INT NOT NULL,
    Trainer_ID INT NOT NULL,
    Spec_ID INT NOT NULL,
    FOREIGN KEY (Trainer_ID) REFERENCES TRAINER(Trainer_ID),
    FOREIGN KEY (Spec_ID) REFERENCES SPECIALISATION(Spec_ID)
);

-- 6. CLASS_BOOKING Table
CREATE TABLE CLASS_BOOKING (
    Booking_ID INT PRIMARY KEY IDENTITY(1,1),
    Mem_ID INT NOT NULL,
    Class_ID INT NOT NULL,
    Booking_Date DATE NOT NULL,
    Attendance_Status VARCHAR(20) CHECK (Attendance_Status IN ('Attended', 'No Show', 'Cancelled')),
    Rating INT CHECK (Rating BETWEEN 1 AND 5),
    FOREIGN KEY (Mem_ID) REFERENCES MEMBER(Mem_ID),
    FOREIGN KEY (Class_ID) REFERENCES FITNESS_CLASS(Class_ID)
);

-- 7. TRAINING_SESSION Table
CREATE TABLE TRAINING_SESSION (
    Session_ID INT PRIMARY KEY IDENTITY(1,1),
    Session_Date DATE NOT NULL,
    Session_Dur INT NOT NULL, -- session duration in minutes
    Session_Type VARCHAR(100) NOT NULL,
    Mem_ID INT NOT NULL,
    Trainer_ID INT NOT NULL,
    Rating INT CHECK (Rating BETWEEN 1 AND 5),
    FOREIGN KEY (Mem_ID) REFERENCES MEMBER(Mem_ID),
    FOREIGN KEY (Trainer_ID) REFERENCES TRAINER(Trainer_ID)
);

-- 8. PAYMENT Table
CREATE TABLE PAYMENT (
    Payment_ID INT PRIMARY KEY IDENTITY(1,1),
    Mem_ID INT NOT NULL,
    Payment_Date DATE NOT NULL,
    Payment_Type VARCHAR(50) NOT NULL, -- 'Membership', 'Training Session', etc.
    Amount DECIMAL(8,2) NOT NULL,
    Payment_Method VARCHAR(30) NOT NULL, -- 'Credit Card', 'Cash', etc.
    FOREIGN KEY (Mem_ID) REFERENCES MEMBER(Mem_ID)
);

